import React, { Component } from 'react';
import './App.css';
import Flexbox from 'flexbox-react'

class Box extends Component {

  render(){
    let { value } = this.props
    return (
      <Flexbox>
          {value}
      </Flexbox>
    )
  }
}

export default Box;
